import React, {Component} from 'react';
import {Link} from  'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';


export default class Navbarframe extends Component{
    render(){
        return(
            <Navbar bg="light" expand="lg">
                <Navbar.Brand href="/">Ticket Log</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                    <Nav.Link href="/">Home</Nav.Link>
                    <Nav.Link href="/users">Create Users</Nav.Link>
                    <Nav.Link href="/tickets">Create Tickets</Nav.Link>
                    </Nav>
                    <Form inline>
                        <FormControl type="text" placeholder="Pending Feature" className="mr-sm-2" />
                        <Button variant="outline-success">Search</Button>
                    </Form>                    
                </Navbar.Collapse>
                </Navbar>
        )
    }
}
